import * as React from "react";
import Box from "@mui/material/Box";
import Link from "@mui/material/Link";
import Grid from "@mui/material/Grid";
import KeyboardDoubleArrowRightIcon from "@mui/icons-material/KeyboardDoubleArrowRight";
import Container from "@mui/material/Container";
import Typography from "@mui/material/Typography";
import logoo from "../../Asserts/Logos/kiddostardez.png";
import "./Footer.css";
import logo from "../../Asserts/Logos/kiddostardez.png";
import Facebook from "@material-ui/icons";
import { IconButton } from "@mui/material";
import { Home } from "@mui/icons-material";
const Footer = () => {
  return (
    <Box>
      <footer class="footer-distributed">
        <div class="footer-left">
          <Box class="footer-company-name">
            <img
              src={logo}
              alt="Logo"
              style={{ height: "100px", margin: "10px", flexGrow: 1 }}
            />
          </Box>
        </div>

        <div class="footer-center">
          <div>
            <IconButton component={Link} to="/" aria-label="Home">
              <Home />
            </IconButton>
          </div>

          <div>
            <i class="fa fa-phone"></i>
            <p>+1.555.555.5555</p>
          </div>

          <div>
            <i class="fa fa-envelope"></i>
            <p>
              <a href="mailto:support@company.com">support@company.com</a>
            </p>
          </div>
        </div>

        <div class="footer-right">
          <p class="footer-links">
            <a href="#" class="link-1">
              Home
            </a>

            <a href="#">Blog</a>

            <a href="#">Pricing</a>

            <a href="#">About</a>

            <a href="#">Faq</a>

            <a href="#">Contact</a>
          </p>

          <div class="footer-icons"></div>
        </div>
      </footer>
    </Box>
  );
};
export default Footer;

